import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom';
const axios = require('axios'); // browser


const Home = () => {

    let navigate = useNavigate();
    useEffect(() => {
        axios.get('http:localhost:4000')
        .then(res => {
            if(res.ok){console.log("Successfully Authenticate")}
            else{
                navigate('login');
            }
        })
        .catch(error => {
            console.log("An error occured", error);
        })
    }, [])
  return (
    <div>Home</div>
  )
}

export default Home
